import React from 'react';
import Task from './Task';


class ToDoList extends React.Component {

    state = [
        {id: 1, taskName: "Tache une", isDone: false},
        {id: 2, taskName: "Faire la vaiselle", isDone: false},
        {id: 3, taskName: "Ranger le garage", isDone: true}
    ];



    render(){

        console.log(this.mappedTasks);
        return (
        <div>
            <div className="ui input">
                <input type="text" placeholder="Add a task.."></input>
            </div>
            {this.state.map((task)=>(
                <Task task={task.taskName} isDone={task.isDone}/>))}
        </div>
        )
        ;
    }

}

export default ToDoList;
